import React from 'react';
import DropdownButton from '../components/customComponents/DropdownButton';

const Home: React.FC = () => {

const handleSelect = (option: string) => {
    alert(`Opción seleccionada: ${option}`);
    };

    const dropdownOptions = [
        { value: 1, text: 'Opción 1' },
        { value: 2, text: 'Opción 2' },
        { value: 3, text: 'Opción 3' }
      ];
  return (
    <div>
      <h2>Acerca de</h2>
      <p>Esta es la página acerca de.</p>
      <DropdownButton 
          options={dropdownOptions}
          onSelect={handleSelect}
        />
    </div>
  );
};

export default Home;
